1. The Fatal Five Who Twisted Time (written by Cary Bates : reprinted in: DC Special Blue Ribbon Digest #8, Legion of Super-Heroes Archives #10)

The Fatal Five travel in the past to Smallville, to alter the timeline so that the Legion of Super-Heroes would never exist. The Fatal Five are foiled by Superboy and the Legion of Super-Heroes and everything reverts back to the way things are supposed to be.

